    function FindCurrentDateIndex() {

        var dates = Object.keys(data.User.Years.Dates);

     for (var i = 0; i < dates.length; i++){

        if (data.User.DateLastOpened === dates[i]) {

            return i;

        }
     }
        console.error("Failed iteration");
        return -1;

    }

    function ChangeDateBackwards() {


        var current_date_index; 
        current_date_index = FindCurrentDateIndex();

        var dates;
        dates = Object.keys(data.User.Years.Dates);

        if (current_date_index > 0) {

                data.User.DateLastOpened = dates[current_date_index - 1];

                document.getElementById('dayheader').textContent=data.User.DateLastOpened;
    
                console.log("Found Current date  " + data.User.DateLastOpened);
            }
            
            else {
                console.log("No dates left to go backward to");
            }

    }

    function ChangeDateForwards() {

        var current_date_index; 
        current_date_index = FindCurrentDateIndex();


        var dates;
        dates = Object.keys(data.User.Years.Dates);


        if (current_date_index < dates.length - 1) {
        
            data.User.DateLastOpened = dates[current_date_index + 1];

            console.log("Found Current date  " + data.User.DateLastOpened);

            document.getElementById('dayheader').textContent=data.User.DateLastOpened;

        }

        else {
            console.log("No dates left to go forward to");
        }

    }


